B.kC=new A.l4("Prevenci\xf3n de la sepsis: Se investiga c\xf3mo prevenir la sepsis en situaciones de alto riesgo, como en pacientes hospitalizados o en unidades de cuidados intensivos. Esto incluye la identificaci\xf3n de factores de riesgo y la mejora de las pr\xe1cticas de higiene y control de infecciones.",null)
